import React from 'react'
import TarjetasVista from './TarjetasVista';

const AreasVista = ({changeView}) => {
    
    var params = changeView({
        collection: "areas",
        filter: {}
    })
    console.log("params:", params)
    return (
			<div className="App">
				<TarjetasVista tarjetas={params} />
			</div>
		);
}

export default AreasVista
